بسم الله الرحمن الرحيم:

{إِنَّ الَّذِينَ يُؤْذُونَ اللَّهَ وَرَسُولَهُ لَعَنَهُمُ اللَّهُ فِي الدُّنْيَا وَالْآخِرَةِ وَأَعَدَّ لَهُمْ عَذَاباً مُهِيناً}

 #الا_رسوال_الله

{ فَمَا ظَنُّكُم بِرَبِّ الْعَالَمِين }

ظَنِّي بِه أنه سَيُكرمني ويَرفعني أكثر وأكثر،
وأن النقلات الكبيرة في حياتي لَم تَأْتي بَعد..❤
